import React, { Component } from 'react';
import { connect } from "react-redux";
import { fetchVideos } from '../actions/actions'
// import {bindActionCreators} from 'redux'

class VideoPlayer extends Component {
    render() {
        return (
            <div className="offset-1 mt-4">
                <iframe width="900" height="500" className="rounded"
                    src={`https://www.youtube.com/embed/${fetchVideos()}?autoplay=1`}allow='autoplay;'>
                </iframe>
            </div>
        )
    }
}
const mapStateToProps = (state) => {
    console.log("full state", state)
    return {
        nowPlayingId: state.nowPlayingId
    }
}

// const mapDispatchToProps = (dispatch) => {
//     return bindActionCreators({ nowPlayingId }, dispatch)
// }


export default connect(mapStateToProps)(VideoPlayer)
